 (props: {
  onClick?: () => void;
  href?: string;
  isActive?: boolean;
  title: string;
  id?: string;
  openContextMenuProps?: object;
}) => {
  const { href, title, onClick, isActive, openContextMenuProps, id } = props;

  const className = ` ${
    isActive ? "dark:bg-blue-800" : "dark:bg-gray-700"
  } dark:hover:bg-gray-600 ${
    isActive ? "bg-blue-300" : "bg-gray-100"
  } light:hover:bg-gray-200 rounded-md border border-black p-2 m-1 cursor-pointer lg:mx-2`;
  if (onClick) {
    return (
      <P
        id={id}
        onClick={onClick}
        className={className}
        {...openContextMenuProps}
      >
        {title}
      </P>
    );
  }

  return (
    <ALink id={id} href={href} className={className}>
      <div id={id} {...openContextMenuProps}>
        {title}
      </div>
    </ALink>
  );
}
